import Header from "../components/Header";
import Footer from "../components/Footer";

const Contact = ({ footerStyle, sideBarStyle }) => {
  return (
    <>
      <>
        <section style={footerStyle} className="main-contact-section ">
          <Header />
          <form className="contact-content-area flex flex-col mt-4 md:mt-4 ml-5 mr-5 md:ml-10 md:mr-10 lg:mr-20 lg:ml-20 gap-4">
            <div
              className="backgroundSidebarImg w-full h-36 h-32 lg:w h-auto bg-cover rounded bg-center"
              style={sideBarStyle}
            ></div>
            <div className="main-contact-content pt-4 pb-8 bg-amber-600 rounded ">
              <h1>Contact Us</h1>
              <input className="mb-2" type="text" />
              <input type="email" />
              <textarea name="" id="" cols="30" rows="10"></textarea>
            </div>
          </form>
        </section>
        <Footer />
      </>
    </>
  );
};

export default Contact;
